<script setup>
let test = ref([{
    index: 0 ,
    name : "test1",
    img : "https://www.shutterstock.com/image-vector/blue-virtual-reality-technology-futuristic-600nw-2309813611.jpg"
}, {
    index: 1 ,
    name : "test2",
    img : "data:image/jpeg;base64,"
}
,
{
    index: 2 ,
    name : "test3",
    img : "data:image/jpeg;base64,"
}

,{
    index: 3 ,
    name : "test4",
    img : "data:image/jpeg;base64,"
}



])

let imgNow = ref({
    index: 0 ,
    name : "test2",
    img : "https://www.shutterstock.com/image-vector/blue-virtual-reality-technology-futuristic-600nw-2309813611.jpg"
})

function next(){
    length = test.value.length
    if(length - 1 !== imgNow.value.index) {
            imgNow.value = test.value[imgNow.value.index +1]

    }else {
        imgNow.value = test.value[0]

    }
}

function left(){
    length = test.value.length
    if( imgNow.value.index !== 0) {
            imgNow.value = test.value[imgNow.value.index -1]

    }else {
        imgNow.value = test.value[length-1]

    }
}
</script>
 
<template>
<div>
    <div @click="left()">ย้อนกลับ</div>

    <div>
        <div class="text-[20px]"> {{ imgNow.name }}</div>
        <img :src="imgNow.img" />
    </div>
    <div @click="next()">ถัดไป</div>
</div>
</template>
 
